import React from "react";

import Link from "../Link";

import { DataType } from "../../redux/actions/post";
import {
  PostContainer,
  PostContent,
  Header,
  Title,
  PostId,
} from "./styledComponents";

const Post: React.FC<DataType> = ({ title, body, id, comments }) => (
  <PostContainer>
    <PostContent>
      <Header>
        <Title>{title}</Title>
        <PostId>{`Post: ${id}`}</PostId>
      </Header>
    </PostContent>
  </PostContainer>
);

export default Post;
